INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('981','695','22','251','5/1/2012 12:00:00 AM','6','Email','I am enjoying the site.  I have worked six hours as of right now and have five hours scheduled in each of the next four weeks.  The work I have been doing consists of tutoring young adults in preparation for taking their GED.  The focus so far has been math.  They are responding well and are eager to learn.  It has been a very positive experience so far.','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('980','695','6','246','5/1/2012 12:00:00 AM','2','Email','Due to Midterms I have only acquired 2 hours of service. But I have full intentions on going both Monday and Friday of this upcoming week to do at least 5 hours or so. Things are going well, Thakela Echols was able to take me on a tour of the facility and introduce me to some of the students that work there and everything seems great. They are working with a program called PLATO which teaches the students Math and Reading materials based on their requirements for the GED. I have just been assisting with them on this program.','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('979','690','6','245','5/1/2012 12:00:00 AM','7.5','Email','So far I have done about 7 1/2 hours at SER central states center. Although I was suppose to be part of the WIA program (GED tutoring), the hours that I scheduled myself for hasn''t allowed me to do any actually tutoring. I scheduled myself for every Friday, but thus far no customers have come in on that day. But they have given my a lot of random jobs to do so I am still pretty occupied (filing, research, mailing, ect.)','Fall 2012',null,null,null);
