INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('977','1083','22','345','5/1/2012 12:00:00 AM','7.5','Email','I have 7.5 hours. Everything is fine however I don''t have a set schedule. The supervisor is still trying to set up the schedule for next week.','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('976','690','6','244','5/1/2012 12:00:00 AM','3','Email','I am doing so-so with hours. I went this last friday from 10:00am-11:45am. So far I have 3 hours done. However I plan to attend the Service Speaks fair to get more hours. I have been tutoring the youth that I am working with, helping them to prepare for an upcoming GED test. ','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('975','690','6','242','5/1/2012 12:00:00 AM','3.5','Email','I actually haven''t been able to go due to family issues I''ve been having.  I will be going every week beginning this Friday.  I went to orientation which was from 930-1 or so.  ','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('974','690','6','241','5/1/2012 12:00:00 AM','6','Email','As of  Friday the 20th we got to "get our hands dirty" and got to work with the students.  Upon arriving to the classroom, Chris Pros was giving each student their progress reports and he then split us up into smaller groups where we were assigned about 3 students and a packet to go over with them.  So far we''ve acquired about 6-8 hours including the orientation we had.  I am copying Jori Liefschultz in this e-mail as well, because we have been and will continue to be doing the service learning hours together because we car pool.','Fall 2012',null,null,null);
